import styled from 'styled-components';

const Container = styled.div`
width: 100%;
height: 80px;
background-color: #e78282;
position: sticky;
z-index: 100;
bottom: 0;
left: 0;
display: flex;
align-items: center;
justify-content: space-between;
overflow-y: hidden; 
overflow-x: scroll; 
 &::-webkit-scrollbar {
    display: none;
 }`;

type Props = {}

const Footer = (props: Props) => {
    return (
        <Container>Footer</Container>
    )
}

export default Footer
